package forloop1;

public class Forloop5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		  int fact=1;
		  int i=1;;  
		  int f=5;
		  for(i=1;i<=f;i++){    
		      fact=fact*i;    
		  }    
		  System.out.println("Factorial of "+f+" is:"+fact);    
		 }  
		  
		    
		}
		
		

	


